import './footer.css'

const Footer = () => {
    return(
        <footer className='foot'>
            <div>
                <img className='img1' src='/logo192.png' alt='React'></img>
                <img className='img2' src='/Logo.png' alt='Logo'></img>
            </div>
        </footer>
    )
}

export default Footer
